import React, { Component } from "react";
import "./App.css";
import "./fire.js";
class Landing extends Component {
  state = {};
  componentDidMount = () => {
    database.checkUserLoggedIn((user) => {
      if (user === false) {
        this.setState({ userpresent: false });
      } else {
        this.setState({ userpresent: true });
      }
    });
  };

  render() {
    return (
      <div className="landingpagecss">
        <h1 className="signinheading">Sign In</h1>
        <button className="langingpagebuttons">Sign Up</button>
        <br />
        <br />
        <button className="langingpagebuttons">Login</button>
      </div>
    );
  }
}

export default Landing;
